import React from "react";
import { useNavigate } from "react-router-dom";
import "./List.css";

const List = () => {
    const navigate = useNavigate();

    return (
        <div className="list-container">
            <button className="back-button" onClick={() => navigate("/home")}>
                <i className="bi bi-arrow-left"></i>
            </button>
        </div>
    );
};

export default List;
